import RankEntry from "./RankEntry";
import "../App.css";
const RankContainer = (props) => {
    const { topUsers } = props;
        return (
            <div className='rank'>
                {topUsers.map( user => (
                    <RankEntry props={user}></RankEntry>
                ))}
            </div>
        )
}

export default RankContainer;
